import { Component } from "react";

export default class Artist extends Component{
    constructor(props){
        super(props);
        this.state = {
            isLoaded: false,
            artists: {
                _embedded: {
                    artistList:[]
                },
                _links:{
                    self: {}
                }
            }
        };
    }
    componentDidMount(){
        fetch("/api/songcollection/artists")
        .then(res => res.json())
        .then(
            (result) => {
                this.setState({
                    isLoaded: true,
                    artists: result
                })
            }
        ) 
    }
    render(){
        const {isLoaded, artists} = this.state
        if(!isLoaded){
            return <div>Loading...</div>
        }else{
            return (
            <ul>
            {artists._embedded.artistList.map(artist => (
                <li key={artist.uuid}>
                {artist.name} {String(artist.active)}
                </li>
            ))}
            </ul>
            )
        }


    }
}
